✔️Realizamos evaluación Biomecanica, Biodinamica y Patomecanica del miembro inferior.
✔️Se evalúa y analiza tu postura.
✔️Se evalúa y analiza el mecanismo de Windlass.
✔️Se evalúa y analiza la linea de Helbing.
