✔️Se analiza el test de Legmotion.
✔️Se analiza el test de Lunge.
✔️Se analiza la medida del navicular.
✔️Se analiza la presión de tu pisada.
✔️Se analiza la distribución de las cargas.
✔️Se analiza oscilaciones de la postura.
✔️Se analiza los ángulos de la pisada en cada marcha.

